import React, { useState } from 'react';
import IITILOGO from "./images/iitilogo.png"; 


  
export default function Left() {
  const[style,setStyle]=useState({color:"black"}); 
  const hover=()=>{
 setStyle({color:"white"});
  }
  return (
    <>
      <div className="left d-flex">
        <div
          className="firstleft d-flex"
          style={{
            flexDirection: "column",
            border: "1px solid black",
            borderRight:"0px solid transparent",
            height: "100vh",
            width: "3rem",
            backgroundColor: "rgb(59 99 139)",
          }}
        >
          <a href="#">
            <i
              class="fa-solid fa-qrcode"
              style={style}
              
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-regular fa-user"
              style={style}
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-regular fa-user"
              style={{
                padding: "1rem",
                textDecoration: "none",
                color: "black",
              }}
            ></i>
          </a>
          <a href="#">
            <i
              class="fa-solid fa-table-cells"
              style={{
                padding: "1rem",
                textDecoration: "none",
                color: "black",
              }}
            ></i>
          </a>
        </div>
        <div
          className="secondleft d-flex"
          style={{
            flexDirection: "column",
            border: "1px solid black",
             borderLeft:"0px solid transparent",
            height: "100vh",
            width: "7rem",
            backgroundColor: "rgb(59 99 139)",
          }}
        >
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            Dashboard
          </a>
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            Profile
          </a>
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            Enroll
          </a>
          <a
            href="#"
            style={{
              padding: "0.75rem",
              textDecoration: "none",
              color: "black",
            }}
          >
            TimeTable
          </a>
          <div className="logo">
            <img src={IITILOGO} alt="logo" style={{ width: "5rem",bottom:"0px"}} />
          </div>{" "}
        </div>
      </div>
    </>
  );
}
